import Button from "../components/Button"
import Header from "../components/Header"
import InputText from "../components/InputText"
function VehicleLogs() {
  const func1=()=>{
    console.log("1");
  }
  const func2=()=>{
    console.log("2");
  }
  const func3=()=>{
    console.log("3");
  }

  return (
    <>
      <Header />
      <div className="topnav">
        <h2>Toll entries/Vehicle entries</h2>
        <p>Filter</p>
        <InputText placeholder='Search Vehicle'/>
        <div className="topnav-right">
        <Button text='Add Vehicle Entry' onClickFunc={func1}/>
        <Button text='Add New Tolls' onClickFunc={func2}/>
        <Button text='View All Tools' onClickFunc={func3}/>
        </div>
      </div>  
      <table className="table-vehicle">
        <thead>
          <th>Vehicle Type</th>
          <th>Vehicle Number</th>
          <th>Date/Time</th>
          <th>Toll Name</th>
          <th>Tariff</th>
        </thead>
      </table>
    </>
    )
}

export default VehicleLogs
